import React from 'react'

const BookPagenation = ({totalbooks, bookPerPage}) => {
  let pages = []
  for (int =1; i<= totalbooks/bookPerPage; i++) {
    pages.push(i)
  }
  return (
    <div>
      {
        pages.map((page, index) => {
          return <button key={index}>{page}</button>
        })
      }
    </div>
  )
}

export default BookPagenation
